import CssBaseline from "@material-ui/core/CssBaseline";
import { ThemeProvider } from "@material-ui/core/styles";
import App from "next/app";
import Head from "next/head";
import React from "react";
import theme from "configs/theme";
import DashBoard from "@admin/Components/AdminLayout/AdminLayout";
import { AuthProvider, ProtectRoute } from "contexts/Auth.context";

function MyApp({ Component, router, pageProps }) {
  // Remove the server-side injected CSS.
  React.useEffect(() => {
    const jssStyles = document.querySelector("#jss-server-side");
    if (jssStyles) {
      jssStyles.parentElement.removeChild(jssStyles);
    }
  }, []);

  let module;
  if (router.pathname.startsWith("/admin")) {
    module = <Component />;
  } else {
    module = (
      <ThemeProvider theme={theme}>
        {/* CssBaseline kickstart an elegant, consistent, and simple baseline to build upon. */}
        <CssBaseline />
        {/* <Component {...pageProps} /> */}
      </ThemeProvider>
    );
  }

  return (
    <React.Fragment>
      <Head>
        <title>My page</title>
        <meta name="viewport" content="minimum-scale=1, initial-scale=1, width=device-width" />
      </Head>
      <AuthProvider>{module}</AuthProvider>
    </React.Fragment>
  );
}

export function FFF(props) {
  return <h1>hello</h1>;
}
MyApp.getStaticProps = async (appContext) => {
  // calls page's `getInitialProps` and fills `appProps.pageProps`
  // const appProps = await App.getInitialProps(appContext);
  // console.log(appProps.Component);

  return { props: { Modulee: 1 } };
};
export default DashBoard(MyApp);
